import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import { Container, Row, Col, Image } from "react-bootstrap";

const images = [
  "/images/aladdin.jpeg",
  "/images/alice.jpeg",
  "/images/donald.png",
  "/images/dory.jpeg",
  "/images/dumbo.jpeg",
  "/images/grumpy.jpeg",
  "/images/anna.jpeg",
  "/images/mickey.jpeg",
  "/images/minnie.jpeg",
  "/images/peter.jpeg",
  "/images/stitch.jpeg",
  "/images/winnie-the-pooh.jpeg",
  "/images/marie.jpeg",
  "/images/chip.jpeg",
  "/images/jessie.jpeg"
];

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Clicky Game! Click on an image to earn points, but don't click on
            any more than once!
          </p>
        </header>
        <Container>
          {images.map(function(image, i) {

            <Col xs={6} md={4}>
              <Image width="200px" src={image} thumbnail />
            </Col>

          })}
        </Container>
      </div>
    );
  }
}

export default App;
